import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { CarComparePageRoutingModule } from './car-compare-routing.module';

import { CarComparePage } from './car-compare.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    CarComparePageRoutingModule
  ],
  declarations: [CarComparePage]
})
export class CarComparePageModule {}
